  <script defer>
      window.onload = () => {
        document.getElementById('export').addEventListener('click', () => {
        var element = document.getElementById('demo');
          var opt = {
            margin:       1,
            filename:     'myfile.pdf',
            image:        { type: 'jpeg', quality: 0.98 },
            html2canvas:  { scale: 2 },
            jsPDF:        { 
              orientation: 'l',
              unit: 'mm',
              format: 'a2',
              putOnlyUsedFonts:true
          }
          };

          html2pdf().from(element).set(opt).save();
      })
    }
  </script>
